// ButtonContainer.js
import React from 'react';
import './page2emr.css';

const buttonNames = [
    {name: 'Seizure'},
    {name:'Heart Attack', image: 'Heart Attack Cardiac Arrest.webp'},
    {name: 'Stroke'},
    {name: 'Choke'},
    {name: 'Sugar'},
    {name: 'Blood'},
    {name: 'Asthma'},
    {name: 'Broken Stuff'},
];

function ButtonContainer() {
    const buttons = buttonNames.map((name, index) => (
        <button key={index} className="button">
            {name}
        </button>
    ));

    return (
        <div className="button-container">
            {buttons}
        </div>
    );
}

export default ButtonContainer;
